import React from 'react'
import './App.css';
import Counter from './components/Counter'
import Timer from './components/Timer';


function App() {
  return (
    <div className="App">
      <h1> Counter</h1>
      <Timer />
      <Counter defaultValue={150} step={4} />
    </div>
  );
}


export default App;
